assert ik.newport.agilis.agilis_status_message(0) == 'Ready (not moving).'
assert ik.newport.agilis.agilis_status_message(3
    ) == 'Moving to limit (currently executing `measure_current_position`, `move_to_limit`, or `move_absolute` command).'
assert ik.newport.agilis.agilis_status_message(4
    ) == 'An unknown status occurred.'
assert ik.newport.agilis.agilis_status_message(-1
    ) == 'An unknown status occurred.'
assert ik.newport.agilis.agilis_status_message(3.14
    ) == 'Status code is not an integer.'
assert ik.newport.agilis.agilis_status_message('1TS0'
    ) == 'Status code is not an integer.'
